import React from "react";
import MyInput from "../../../../UI/myCheckbox/MyCheckbox";
import classes from "./brands.module.scss";

const Brands = ({ brands }) => {
  return (
    <div className={classes.brands}>
      <h3>Brands</h3>
      <form>
        {brands.map((item) => (
          <MyInput
            key={Date.now() + Math.random()}
            item={item}
            label={item.name}
          />
        ))}
      </form>
    </div>
  );
};

export default Brands;
